import React from 'react';
import Plotly from "plotly.js"
import createPlotlyComponent from 'react-plotly.js/factory';
const Plot = createPlotlyComponent(Plotly);

export  class GraphicGroup extends React.Component
{
  render(){
    return (
    <SingleGraphic/>
    );
  }
}


function SingleGraphic (){
  const plotlydata =[
    {
      x: [1, 1.5, 1.6, 1.7, 1.9, 2.1, 2.3, 2.6, 2.8, 3.1, 3.3, 3.6, 3,9, 4.0, 4.2, 4.9, 5.1, 5.2, 5.3, 5.7, 5.8, 5.9, 6.3, 6.5, 6.8, 6.9, 7.2, 7.4, 7.8, 7.9, 8, 8.6, 8.8, 9.4, 9.5, 9.6, 10, 10.3, 10.4, 10.5],
      y: [-30, -10, -30, 30, 30, 40, 37, 7, 40, 25, 25, -4, -37, 36, 36, 40, 24, -1, -21, -1, -1, -21, 11, 40, -25, -25, 18, -15, -10, -40, 38, 10, 37, -30, -4, -4, -10, -40, -35, 10],
      type: 'bar'
    }
  ];
  return  <Plot
        data={plotlydata}
        layout={ {width: 500, height: 500, title: 'A Fancy Plot'} }
      />



}
